import Cards from "../cards";
import Burger from "../menuBurger";

function Home() {
  const veiculos = [
    {
      nome: "Scania G500",
      ano: "2019",
      valor: "R$ 639.666,00",
      imagem: "https://img.olx.com.br/images/84/848238421872924.jpg",
    },
    {
      nome: "Scania G500 XT 8x4",
      ano: "2019",
      valor: "R$ 745.000,00",
      imagem: "https://img.olx.com.br/images/84/848238421872924.jpg",

    },
    {
      nome: "Scania G440 6x4",
      ano: "2020",
      valor: "R$ 630.000,00",
      imagem: "https://img.olx.com.br/images/84/848238421872924.jpg",

    },
    {
      nome: "Mercedes-benz Actros 6x4",
      ano: "2021/2022",
      valor: "R$ 455.000,00",
      imagem: "https://img.olx.com.br/images/84/848238421872924.jpg",
    },
    {
      nome: "Volvo FH 540 6x4",
      ano: "2022",
      valor: "R$ 880.000,00",
      imagem: "https://img.olx.com.br/images/84/848238421872924.jpg",
     },
    
  ];
  return (
    <>
      <Burger />
      <div>
        {veiculos.map((veiculo) => (
          <Cards
            key={veiculo.nome}
            nome={veiculo.nome}
            ano={veiculo.ano}
            imagem={veiculo.imagem}
            valor={veiculo.valor}
          />
        ))}
      </div>
    </>
  );
}
export default Home;
